import { combineReducers } from 'redux'
import city from './city'
import counter from './counter'
import product from './product'

export default combineReducers({
    city,
    count:counter,
    product,
})

/*
现在合并后的数据就变成这样了

{
  city:"无锡",
  count:0
}
*/
